from django.db import modelsfrom core.models.base import BaseEntityclass Experience(BaseEntity):    organization_name = models.CharField(max_length=120)    designation = models.CharField(max_length=70)    job_year = models.CharField(max_length=70)    def __str__(self):        return self.organization_nameclass Availability(BaseEntity):    day = models.CharField(max_length=50)    start_time = models.TimeField(auto_now_add=False)    end_time = models.TimeField(auto_now_add=False)    def __str__(self):        return self.dayclass Laboratories(BaseEntity):    lab_name = models.CharField(max_length=120)    machinery_name = models.CharField(max_length=150, blank=True, null=True)    total_machinery = models.IntegerField(default=1)    def __str__(self):        return self.lab_nameclass Department(BaseEntity):    department_name = models.CharField(max_length=80)    employee_type = models.CharField(max_length=120)    def __str__(self):        return self.employee_typeclass Service(BaseEntity):    service_name = models.CharField(max_length=100)    price = models.IntegerField(default=1)    discount_price = models.IntegerField(default=0)    laboratories = models.ForeignKey(Laboratories, on_delete=models.CASCADE, null=True, blank=True,                                     related_name='service_laboratories')    def __str__(self):        return self.service_name